import React from "react";
import SearchBar from "./SearchBar"
import { Link } from "react-router-dom"

export default function Nav (props) {
    return (
        <>
        <Link to="/about">
        <button>About</button>
        </Link>

        <Link to="/home">
        <button >Home</button>
        </Link>
        
        <SearchBar onSearch={props.onSearch} randomChar={props.randomChar} />
        </>
    )
}
